import { Component } from "react";
import './user-form.styles.css';

const UserForm = () => {
    // console.log(props);
    return (
        <div className="form-container">
           <form action="" method="POST" class="form-horizontal" role="form">
            <div class="form-group">
              <input type="text" name="name" placeholder="Your Name" class="form-control"></input>
            </div>
            <div class="form-group">
              <input type="email" name="email" placeholder="Your Email" class="form-control"></input>
            </div>
            <div class="form-group">
              <textarea name="message" placeholder="Your message" class="form-control"></textarea>
            </div>
            <input type="hidden" name="_subject" value="New email from Contact Me Form!" class="form-control"></input>
            <input type="hidden" name="_next" value="thanks.html" />
            <div class="form-group">
              <input type="submit" class="btn btn-primary btn-xl">
              {/* <i class="fa fa-envelope" style={font-size:48px;color:red}></i> */}
              <i className="fa fa-envelope" style={{ fontSize: '48px', color: 'red' }}></i>

              </input>
            </div>
            {/* <a href="mailto:rabindradahal2015@gmail.com">Email</a> */}
          </form>
        </div>
    );
};

export  {UserForm};
